import './Home.css';
import Button from '@mui/material/Button';

function Home() {
  return (
    <>
      <h1>Welcome to Best-Fit Colleges</h1> 
      <Button variant="contained" class = "button">Tab 1</Button>
      <Button variant="contained" class = "button">Tab 2</Button>
    </>
  );
}

export default Home;
